import React from 'react';
import { Link } from 'react-router-dom';
export default function Header({ Home, About }) {
  return (
    <>
      <nav>
        <ul>
          <Link to="/">
            <p>Home</p>
          </Link>
        </ul>
      </nav>
    </>
  );
}
